INSERT INTO `pages` VALUES (2,'Static Pages','','static-pages',NULL,NULL,0,'','','',0,NULL),(3,'Articles','','articles',NULL,NULL,0,'','','',0,NULL),(7,'About Us','<p style=\"text-align: center;\">Narapatih &amp; Associates (PT Narapatih Inspiratama) merupakan sebuah perusahaan yang bergerak dalam bidang Coaching, Assesment, Konsultasi, dan Training yang berdiri pada tahun 2004, dengan tujuan untuk ikut serta dalam usaha meningkatkan kualitas Sumber Daya Manusia (SDM) menghadapi persaingan global yang semakin ketat. Dengan SDM yang berkualitas unggul dan berstandar Internasional, dengan sendirinya akan meningkatkan kinerja perusahaan dan mampu berkompetensi dalam persaingan global.</p>','about-us','f3ccdd27d2000e3f9255a7e3e2c48800.jpg','0fe4f8b5958db18606f528ab05035c91.jpg',2,NULL,NULL,NULL,0,NULL),(8,'Services','<p style=\"text-align: center;\">Menggunakan pendekatan manajemen digabungkan dengan metode&nbsp;<em>Neo-Psychology&nbsp;</em>yang mampu mengubah pola pikir dengan cukup cepat mengakses pikiran bawah sadar seseorang, serta mengubah sistem nilai yang ada didalamnya.</p>','services',NULL,NULL,2,NULL,NULL,NULL,0,NULL),(9,'Training & Coaching','<p style=\"text-align: justify;\">Menghasilkan tim yang mampu dirahkan untuk bisa menjadi contoh sehingga bisa mempengaruhi lingkup yang lebih luas, baik secara personal maupun profesional.</p>','training-and-coaching','e08fe7a0e9958acf28b5b684e0e2983a.jpg','0fe4f8b5958db18606f528ab05035c91.jpg',8,NULL,NULL,NULL,0,NULL),(10,'Management Consultant','<p style=\"text-align: justify;\">Konsultan kami akan membantu organisasi anda mencapai hasil yang berkelanjutan dengan memberdayakan orang dan memperbaiki sistem dan proses.</p>','management-consultant',NULL,NULL,8,NULL,NULL,NULL,0,NULL),(11,'Research Center','<p>Narapatih adalah sebuah lembaga independen yang melakukan penelitian dan kajian tentang emosi dan perilaku manusia.</p>','research-center',NULL,NULL,8,NULL,NULL,NULL,0,NULL),(12,'Contact Us','<p>lorem ipsum dolor sit amet</p>','contact-us',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL),(13,'Homepage','','homepage',NULL,NULL,2,'','','',0,NULL),(14,'About Narapatih','<p>Narapatih &amp; Associates (PT Narapatih Inspiratama) merupakan sebuah perusahaan yang bergerak dalam bidang Coaching, Assesment, Konsultasi, dan Training yang berdiri pada tahun 2004.</p>','about-narapatih','87d0de889766a6f3f0c1e35d4d2c60e9.jpg',NULL,7,NULL,NULL,NULL,1,NULL),(15,'Mission','<p>Tujuan Narapatih sendiri untuk ikut serta dalam usaha meningkatkan kualitas Sumber Daya Manusia (SDM) menghadapi persaaingan global yang semakin ketat. Dengan SDM yang berkualitas unggul dan berstandar Internasional, dengan sendirinya akan meningkatkan kinerja perusahaan dan mampu berkompetensi dalam persaingan global.</p>','mission','8d46d942062fc64d50172d258b412a47.jpg',NULL,7,NULL,NULL,NULL,2,NULL),(16,'Activity','<p>sdadadsadsaddd</p>','activity','524dabc47277446b3bc2c75937bb825e.jpg',NULL,7,NULL,NULL,NULL,3,NULL),(17,'Our Focus','<p>Menggunakan pendekatan manajemen digabungkan dengan metode <em>Neo-Psychology&nbsp;</em>yang mampu mengubah pola pikir dengan cukup cepat. Salah satu metode yang mampu dengan cepat mengakses pikiran bawah sadar seseorang, serta mengubah sistem nilai yang ada di dalamnya.</p>\r\n<p>Pendekatan&nbsp;<em>Neo-Psychology&nbsp;</em>merupakan sinergi dari beberapa keilmuan yang telah mengalami penerapan dan penelitian selama berpuluh-puluh tahun, dan telah diterapkan dalam banyak bidang diberbagai negara maju di dunia (<em>North America, Europe, Australia, dll)</em>. Adapun keilmuan yang terdapat didalamnya adalah&nbsp;<em>Psychophysiology, Psychology Communication,&nbsp;</em>dan&nbsp;<em>Psychotherapy.</em></p>\r\n<p>Dengan metode ini, berbagai potensi terpendam dalam pikiran manusia dapat dengan relatif mudah dan cepat diungkapkan atau diberdayakan. Terbukti berhasil membantu banyak orang mencapai keberhasilan yang luar biasa. Dari mengatasi kebiasaan dan perilaku yang negatif sampai mencapai prestasi puncak, sampai untuk mengenali pola komunikasi dan perilakunya.</p>','our-focus',NULL,NULL,7,NULL,NULL,NULL,4,NULL),(18,'Resources','','resources',NULL,NULL,13,'<p>Lorem ipsum dolor sit amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet dolore magna aliquam erat volutpat.</p>','','',0,NULL),(19,'Research article #1','<p>Lorem ipsum dolor sit amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet dolore magna aliquam erat volutpat.</p>\r\n<p>Lorem ipsum dolor sit amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet dolore magna aliquam erat volutpat.</p>\r\n<p>Lorem ipsum dolor sit amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet dolore magna aliquam erat volutpat.</p>','research-article-1','156005c5baf40ff51a327f1c34f2975b.jpg',NULL,3,'<p>Lorem ipsum dolor sit amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet dolore magna aliquam erat volutpat.</p>','','',0,'2016-03-26 18:50:45'),(20,'Article #2','<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ut sed mi nunc. Maecenas auctor lectus sit amet mattis ultrices. Integer ut semper est. Sed fermentum orci augue. Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Nunc tincidunt tellus justo, nec porttitor mauris lobortis sit amet. In vulputate pharetra neque ut viverra. Morbi vel porta justo, non interdum urna. Aliquam faucibus convallis eros, a condimentum arcu facilisis quis. Mauris ex turpis, aliquam sit amet rutrum id, mollis non nunc. Donec est magna, consequat eget nulla ac, ullamcorper bibendum leo. Pellentesque mollis eget magna bibendum pretium. Aliquam aliquet viverra ex eget congue. Donec commodo molestie ultricies. Vivamus eget leo felis. Vivamus facilisis porta viverra.</p>\r\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ut sed mi nunc. Maecenas auctor lectus sit amet mat