L,'Melihat sesuatu\r\nMembicarakan sesuatu\r\nMengerjakan sesuatu','2016-02-15 02:41:02','2016-02-15 02:31:00'),(38,6,0,'Ketika anda gugup karena suatu hal, anda cenderung:',1,NULL,'Membayangkan hal buruk yang bisa terjadi\r\nBerkata-kata dalam hati apa yang membuat khawatir\r\nTidak dapat duduk diam, terus bergerak secara konstan','2016-02-15 02:41:16','2016-02-15 02:31:48'),(39,6,0,'Anda merasa cocok dengan orang lain biasanya karena:',1,NULL,'Bagaimana orang itu kelihatannya\r\nApa yang orang itu katakan pada anda\r\nBagaimana orang itu menentukan perasaan anda','2016-02-15 02:41:26','2016-02-15 02:32:48'),(40,6,0,'Ketika anda menghadapi sebuah ujian, anda akan:',1,NULL,'Menulis berbagai hal tentang catatan-catatan\r\nBerkata-kata dalam hati atau mendiskusikannya dengan orang lain\r\nMembayangkan perasaan saat ujian dan/atau membuat “rumus khusus” untuk mengingat','2016-02-15 02:41:42','2016-02-15 02:33:29'),(41,6,0,'Ketika menjelaskan sesuatu pada seseorang, anda cenderung:',1,NULL,' Menunjukkan padanya apa yang anda maksud\r\n Menjelaskan dengan berbagai cara sampai mereka mengerti\r\n Memotivasi mereka untuk mencoba dan berbicara dengan mereka selama mereka mencobanya','2016-02-15 02:41:56','2016-02-15 02:34:34'),(42,6,0,'Anda tertarik pada:',1,NULL,'Fotografi, atau menonton film, atau melihat orang-orang beraktifitas\r\nMeluangkan waktu untuk mendengarkan musik (radio,kaset,dll) atau berbincang-bincang dengan teman\r\nMelakukan kegiatan fisik, olahraga, berkontemplasi, atau berjalan-jalan','2016-02-15 02:42:40','2016-02-15 02:42:40'),(43,6,0,'Kebanyakan, waktu luang anda habiskan untuk:',1,NULL,'Menonton TV\r\nNgobrol dengan teman\r\nMelakukan aktivitas fisik atau mengutak-utik sesuatu','2016-02-15 02:43:18','2016-02-15 02:43:18'),(44,6,0,'Ketika baru pertama kali berhubungan dengan orang baru:',1,NULL,'Anda mengatur pertemuan langsung\r\nAnda berbicara panjang di telepon\r\nAnda mencoba untuk mencari aktivitas bersama','2016-02-15 02:43:56','2016-02-15 02:43:56'),(45,6,0,'Biasanya, perhatian anda adalah bagaimana seseorang:',1,NULL,'Terlihat dan cara berpakaiannya\r\nSuara dan kata-katanya\r\nBerdiri dan caranya bergerak','2016-02-15 02:44:32','2016-02-15 02:44:32'),(46,6,0,'Ketika anda marah:',1,NULL,'Terus membayangkan dalam pikiran, penyebab atau apa yang membuat anda marah\r\nBerkata-kata lebih keras dan mengatakan pada orang lain bagaimana perasaan anda\r\nBergerak dengan gerakan lebih cepat, menutup pintu dengan lebih keras, atau meletakkan barang-barang dengan agak melempar','2016-02-15 02:45:13','2016-02-15 02:45:13'),(47,6,0,'Anda lebih cenderung mudah mengingat:',1,NULL,'Wajah\r\nNama \r\nHal yang dilakukan','2016-02-15 02:45:52','2016-02-15 02:45:52'),(48,6,0,'Anda merasa tahu ketika seseorang berbohong kepada anda, ketika:',1,NULL,'Mereka menghindari tatap mata langsung\r\nSuara mereka berubah\r\nGetaran yang anda rasakan dari mereka','2016-02-15 02:46:30','2016-02-15 02:46:30'),(49,6,0,'Ketika anda bertemu dengan kawan lama, anda cenderung:',1,NULL,'Mengatakan “wah, senang sekali melihatmu lagi”\r\nMengatakan “wah, senang sekali mendengar suaramu lagi”\r\nMenyalami dengan hangat dan memeluknya','2016-02-15 02:47:12','2016-02-15 02:47:12'),(50,7,0,'Pilih 1 (satu) jawaban di setiap nomor, yang menurut anda isinya paling mewakili atau menggambarkan diri anda.',1,NULL,'Pantang menyerah\r\nLincah\r\nPersuasif\r\nDamai','2016-02-15 02:56:16','2016-02-15 02:56:16'),(51,7,0,'Pilih 1 (satu) jawaban di setiap nomor, yang menurut anda isinya paling mewakili atau menggambarkan diri anda.',1,NULL,'Ikhlas\r\nRela berkorban\r\nMudah bersosialisasi\r\nBerkemauan keras','2016-02-15 02:57:49','2016-02-15 02:57:49'),(52,7,0,'Pilih 1 (satu) jawaban di setiap nomor, yang menurut anda isinya paling mewakili atau menggambarkan diri anda.',1,NULL,'Menghargai\r\nTerkendali\r\nKompetitif\r\nMeyakinkan','2016-02-15 02:58:40','2016-02-15 02:58:40'),(53,7,0,'Pilih 1 (satu) jawaban di setiap nomor, yang menurut anda isinya paling mewak