INSERT INTO `segments` VALUES (1,'test','Test Segment 1','lorem ipsum dolor sit amet','2016-01-26 17:32:26','2016-02-21 14:20:39',1,0,0),(5,'Danamon02','Employee Connection Survey','<p>Di dalam perubahan yang terus terjadi di dunia ini, yang tanpa kecuali dialami oleh berbagai jenis industri di dalamnya, pastinya akan mempengaruhi banyak aspek di dalam kehidupan, baik personal maupun profesional.</p>\r\n<p>Salah satu aspek yang akan terpengaruh adalah koneksi /keterhubungan antar karyawan (employee connection), secara personal atau profesional.</p>\r\n<p>Berdasarkan hal ini, selama beberapa waktu mendatang kami akan melakukan survei terhadap karyawan BUMA. Survei ini dilakukan untuk mendapatkan pemahaman yang lebih baik tentang kondisi keterhubungan antar karyawan, berdasarkan berbagai aspek (personal dan profesional).</p>\r\n<p>Masukan anda dari pengisian survey ini sangat penting bagi kami, dan survei ini adalah kesempatan bagi anda untuk mengungkapkan pendapat.</p>\r\n<p>Kami akan menggunakan hasil survei untuk tiga tujuan:</p>\r\n<p>1. untuk mengenali pola komunikasi yang ada selama ini dan melihat efektivitasnya terhadap keterhubungan antar karyawan.</p>\r\n<p>2. untuk meningkatkan kebijakan kami dalam membangun situasi komunikasi antar karyawan yang lebih kondusif, praktis, dan efektif.</p>\r\n<p>3. untuk menghasilkan keterhubungan antar individu dalam tim yang lebih baik, sehingga mampu meningkatkan kinerja kerja tim.</p>\r\n<p>Survei ini dikelola oleh sebuah institusi survei independen, dimana detail masukan anda akan tetap terjaga kerahasiaannya. Manajemen hanya akan melihat data gabungan untuk kelompok responden.</p>\r\n<p>Kami mengharapkan anda untuk bijaksana, jujur, dan apa adanya ketika anda mengerjakan survei ini.</p>\r\n<p>Hasil survei yang sudah dianalisa akan ditindaklanjuti dengan perubahan kebijakan untuk mendukung 3 poin diatas, untuk memastikan bahwa BUMA akan menjadi tempat yang lebih baik dan menyenangkan untuk bekerja.</p>\r\n<p>Kami membutuhkan mendapatkan partisipasi anda 100% dalam rangka untuk memastikan bahwa suara setiap karyawan didengar dengan baik. Terima kasih untuk menyediakan waktu dan memberikan masukan dalam survey ini.</p>','2016-02-13 18:08:49','2016-02-21 14:20:44',1,1,0),(6,'Representational System ID','Representational System','<p>Pilih 1 (satu) jawaban dari tiap nomor, yang menurut anda isinya <strong>paling mewakili jawaban Anda</strong> dari pertanyaan/pernyataan di nomor tersebut.</p>\r\n<p>Jika Anda sudah mengerti instruksi yang diberikan, silahkan lanjut.</p>','2016-02-15 01:38:17','2016-02-23 02:54:04',1,1,1),(7,'Communication Profile ID','Communication Profile','<p>Pilih 1 (satu) jawaban di setiap nomor, yang menurut Anda isinya <strong>paling mewakili atau menggambarkan diri Anda</strong>. <br /><br />Jika Anda sudah mengerti instruksi yang diberikan, silahkan lanjut.</p>','2016-02-15 01:41:03','2016-02-23 02:53:52',1,1,1),(8,'Change Preference ID','Change Preference','<p>Pada setiap kategori (tiap nomor), terdapat 4 (empat) buah pilihan. <strong>Berikan pembobotan</strong> di tiap pilihan tersebut, dari yang paling sesuai atau mendekati diri anda, sampai dengan yang paling tidak sesuai atau tidak mendekati diri anda.</p>\r\n<p>Bobot angka 4 pada pilihan yang paling sesuai dengan anda, nilai 3 (tiga) untuk pilihan kedua, nilai 2 (dua) untuk pilihan ketiga, dan nilai 1 (satu) untuk kata yang paling tidak menggambarkan Anda.</p>\r\n<p><strong>Contoh Pengisian:</strong> <br />Pekerjaan Peneliti A ___3___ <br />Administrator &nbsp; &nbsp; &nbsp; B ___4___ <br />Penulis &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;C ___2___ <br />Pekerja sosial &nbsp; &nbsp; &nbsp; D ___1___ <br /><br />Dengan pembobotan di atas, berarti menurut Anda pekerjaan yang paling sesuai dengan anda adalah Administrator, dilanjutkan dengan Peneliti, Penulis dan Pekerja Sosial. Jika Anda sudah mengerti instruksi yang diberikan, silahkan lanjut.</p>','2016-02-15 01:42:27','2016-02-23 02:55:06',1,1,1),(9,'Meta Program ID','Meta Program','<p>Pilih 1 (satu) jawaban di setiap nomor, yang menurut Anda isinya <strong>paling mewakili atau paling dekat dengan diri Anda</strong>. <br /><br />Jika Anda sudah mengerti instruksi yang diberikan, silahkan lanjut.</p>','2016-02-15 01:43:38','2016-02-23 02:55:32',1,1,1),(10,'Data Diri','Data Diri','<p>Lengkapi data diri Anda di bawah ini :</p>','2016-02-15 06:38:45','2016-02-21 14:21:31',1,0,0),(11,'PACS 01','','<p>lorem ipsum dolor sit amet</p>','2016-02-21 02:43:43','2016-02-22 05:03:36',1,0,0),(12,'fpp','foo','<p>sadasdd</p>','2016-02-22 04:09:06','2016-02-22 04:09:15',1,1,0),(13,'testing','testing','<p>dasdfasdfasdfa</p>','2016-02-22 04:43:05','2016-02-22 04:50:26',1,1,0),(14,'Biodata ID','Biodata','<h2><strong>Clock&amp;Compass Assessment Form</strong></h2>\r\n<p>Supported by Narapatih &amp; Associates</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','2016-02-22 05:03:20','2016-02-22 05:03:20',1,0,1),(15,'Employee Connection Survey','Employee Connection Survey','<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"text-align: left;\" align=\"center\"><span lang=\"IN\" style=\"font-size: 14.0pt; line-height: 115%; font-family: Cambria; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin;\">Supported by Narapatih &amp; Associates</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%;\">Di dalam perubahan yang terus terjadi di dunia ini, yang tanpa kecuali dialami oleh berbagai jenis industri di dalamnya, pastinya akan mempengaruhi banyak aspek di dalam kehidupan, baik personal maupun profesional. Salah satu aspek yang akan terpengaruh adalah koneksi/keterhubungan antar karyawan (<em style=\"mso-bidi-font-style: normal;\">employee connection</em>), secara personal atau profesional.<br /><br /></span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%;\">Berdasarkan hal ini, selama beberapa waktu kedepan kami akan melakukan survei untuk mendapatkan pemahaman yang lebih baik tentang kondisi keterhubungan antar karyawan di BUMA, berdasarkan berbagai aspek (personal dan profesional), termasuk aspek psikologis individu dan kolektif. Masukan anda dari pengisian survei ini sangat penting bagi kami.<br /><br /></span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%;\">Kami akan menggunakan hasil survei untuk tiga tujuan:<br /><br /></span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%;\">1. Untuk mengenali pola komunikasi yang ada selama ini dan melihat efektivitasnya terhadap keterhubungan antar karyawan.<br /><br /></span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%;\">2. Untuk meningkatkan kebijakan kami dalam membangun situasi komunikasi antar karyawan yang lebih kondusif, praktis, dan efekti.<br /><br /></span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%;\">3. Untuk menghasilkan keterhubungan antar individu dalam tim yang lebih baik, sehingga mampu meningkatkan kinerja kerja tim.<br /><br /></span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%;\">Survei ini dikelola oleh sebuah institusi survei independen, dimana detail masukan anda akan tetap terjaga kerahasiaannya. Manajemen hanya akan melihat data gabungan untuk kelompok responden. Kami mengharapkan anda untuk bijaksana, jujur, dan apa adanya dalam mengerjakan survei ini.<br /><br /></span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%;\">Hasil survei yang sudah dianalisa akan ditindaklanjuti dengan perubahan kebijakan untuk mendukung 3 poin diatas, untuk memastikan bahwa BUMA akan menjadi tempat yang lebih baik dan menyenangkan untuk bekerja. Kami membutuhkan mendapatkan partisipasi anda 100% dalam rangka untuk memastikan bahwa suara setiap karyawan didengar dengan baik.<br /><br /></span><span style=\"font-size: 12pt; line-height: 115%;\">Terima kasih untuk menyediakan waktu dan memberikan masukan dalam survei ini.</span></p>','2016-03-03 21:47:47','2016-03-03 22:00:40',1,0,1);
